import React from "react";
var style = {
  backgroundColor: "#F8F8F8",
  borderTop: "1px solid #E7E7E7",
  textAlign: "center",
  padding: "20px",
  position: "fixed",
  left: "0",
  bottom: "0",
  height: "60px",
  width: "100%",
};

var phantom = {
  display: "block",
  padding: "20px",
  height: "60px",
  width: "100%",
};

const Footer = () => {
  return (
    <div style={{ position: absolute, left: 0, bottom: 0, right: 0 }}>
      <p className="text-white bg-info rounded m-2 p-2 text-center">
        Coded with Love
      </p>
    </div>
  );
};

export default Footer;
